import jxl.*
import eviware.soapui.model.*

filePath = "C:/Users/NymishaNunna/Desktop/API Testing Program/Project/DataSheets/ProductDetails.xls"


File Excel = new File(filePath)

Workbook wb = Workbook.getWorkbook(Excel)
Sheet sh = wb.getSheet("Sheet1")

rowSize =sh.getRows().toInteger()
columnSize =sh.getColumns().toInteger()

log.info " Number of rows are " + rowSize
log.info " Number of comuns " + columnSize

for(def i=1;i<rowSize; i++)
{	//can have another for loop if more colouns but I have only two columns so not using it.
	sku = sh.getCell(0,i).getContents()
	name = sh.getCell(1,i).getContents()

	log.info sku
	log.info name

	context.testCase.setPropertyValue("sku",sku)
	context.testCase.setPropertyValue("name",name)

	def tc_createProduct = context.testCase.getTestStepByName('CreateProduct')
	def runner_tc_createProduct = tc_createProduct.run(testRunner,context)

	log.info "Status: $runner_tc_createProduct.status, Time taken for testStep execution is $runner_tc_createProduct.timeTaken ms"

	def tc_getProductsList = context.testCase.getTestStepByName('GetProductsList')
	def runner_tc_getProductsList = tc_getProductsList.run(testRunner,context)


	log.info "Status: $runner_tc_getProductsList.status, Time taken for testStep execution is $runner_tc_getProductsList.timeTaken ms"

	def tc_getProduct = context.testCase.getTestStepByName('GetProduct')
	def runner_tc_getProduct = tc_getProduct.run(testRunner,context)


	log.info "Status: $runner_tc_getProduct.status, Time taken for testStep execution is $runner_tc_getProduct.timeTaken ms"

	def tc_deleteProduct = context.testCase.getTestStepByName('DeleteProduct')
	def runner_tc_deleteProduct = tc_deleteProduct.run(testRunner,context)

	log.info "Status: $runner_tc_deleteProduct.status, Time taken for testStep execution is $runner_tc_deleteProduct.timeTaken ms"

}

